 queue: zipkin\n    base-url: http://localhost:9411/\n  #### stream rabbit mq\n  cloud:\n    stream:\n      binders:\n        my-rabbit:\n          type: rabbit\n          environment:\n            spring:\n              rabbitmq:\n                host: localhost\n                port: 5672\n                username: admin\n                password: admin\n      bindings:\n        recordLog-out-0:\n          destination: record-log-topic\n          content-type: application/json\n          binder: my-rabbit\n        recordLog-in-0:\n          destination: record-log-topic\n          content-type: application/json\n          binder: my-rabbit\n          group: record-log-group\n          consumer:\n            # 如果最大尝试次数为1，即不重试\n            # 默认是做3次尝试\n            max-attempts: 1\n            # 两次重试之间的初始间隔\n            backOffInitialInterval: 2000\n            # 重试最大间隔\n            backOffMaxInterval: 10000\n            # 每次重试后，间隔时间乘以的系数\n            backOffMultiplier: 2\n            # 不重试\n          # retryableExceptions:\n          #   java.lang.IllegalArgumentException: false\n      function:\n        definition: recordLog\n      rabbit:\n        bindings:\n          recordLog-in-0:\n            consumer:\n              requeue-rejected: true\n    #### seata\n    alibaba:\n      seata:\n        tx-service-group: sc_test_tx_group\n####seata\nseata:\n  enabled: true\n  application-id: ${spring.application.name}\n  registry:\n    type: nacos\n    nacos:\n      application: seata-server\n      server-addr: 192.168.3.122:8848\n      namespace: dev\n      group: sc-dev\n      cluster: cluster-dev\n      username: nacos\n      password: nacos\n  service:\n    vgroup-mapping:\n      sc_test_tx_group: cluster-dev\n#### swagger\nspringfox:\n  documentation:\n    enabled: true\n    auto-startup: true\n    swagger-ui:\n      enabled: true\n    open-api:\n      enabled: true\n', '0f8919a44b93d92413f62e25a514da51', '2022-05-14 20:08:45', '2022-05-14 20:08:45', 'nacos', '0:0:0:0:0:0:0:1', 'I', 'dev', '');
